import React, { useState, useEffect } from 'react';
import { Container, Grid, Card, CardContent, Typography, TextField } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import WbSunnyIcon from '@mui/icons-material/WbSunny'; // Icon for Min Temp
import AcUnitIcon from '@mui/icons-material/AcUnit'; // Icon for Max Temp
import OpacityIcon from '@mui/icons-material/Opacity'; // Icon for Humidity
import WindPowerIcon from '@mui/icons-material/WindPower'; // Icon for Wind Speed
import { motion } from 'framer-motion';

const Homepage = () => {
    const [location, setLocation] = useState('');
    const [predictions, setPredictions] = useState([]);

    // Function to fetch weather predictions based on location
    const fetchPredictions = async () => {
        // Your fetching logic here
    };

    // Handle input change
    const handleInputChange = (e) => {
        setLocation(e.target.value);
    };

    // Handle search submission
    const handleSearch = (e) => {
        e.preventDefault();
        fetchPredictions();
    };

    useEffect(() => {
        // Fetch initial predictions or handle on mount
        fetchPredictions();
    }, []);

    return (
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
            <Container>
                <form onSubmit={handleSearch} style={{ display: 'flex', alignItems: 'center', marginBottom: '20px' }}>
                    <TextField
                        label="Search Location"
                        variant="outlined"
                        value={location}
                        onChange={handleInputChange}
                        InputProps={{
                            endAdornment: <SearchIcon />
                        }}
                        fullWidth
                    />
                </form>
                <Grid container spacing={4}>
                    {/* Left Section */}
                    <Grid item xs={12} md={4}>
                        <Grid container spacing={3}>
                            <Grid item xs={12}>
                                <Card style={{ 
                                    backgroundColor: "rgba(255, 255, 255, 0.2)", 
                                    borderRadius: "10px", 
                                    boxShadow: "0 2px 10px rgba(0, 0, 0, 0.5)", 
                                    textAlign: 'center',
                                    height: '180px', // Increased height
                                    width: '100%', // Full width for responsiveness
                                }}>
                                    <CardContent>
                                        <WbSunnyIcon style={{ fontSize: '50px', color: '#FFEB3B' }} />
                                        <Typography variant="h6" style={{ color: '#BBDEFB' }}>Min Temp</Typography>
                                        <Typography variant="h5" style={{ color: 'white' }}>{predictions[0]?.min_temp || 0}°C</Typography>
                                        <Typography variant="body2" style={{ color: 'white' }}>Chilly, stay warm!</Typography> {/* Conclusion */}
                                    </CardContent>
                                </Card>
                            </Grid>
                            <Grid item xs={12}>
                                <Card style={{ 
                                    backgroundColor: "rgba(255, 255, 255, 0.2)", 
                                    borderRadius: "10px", 
                                    boxShadow: "0 2px 10px rgba(0, 0, 0, 0.5)", 
                                    textAlign: 'center',
                                    height: '180px', // Increased height
                                    width: '100%', // Full width for responsiveness
                                }}>
                                    <CardContent>
                                        <AcUnitIcon style={{ fontSize: '50px', color: '#BBDEFB' }} />
                                        <Typography variant="h6" style={{ color: '#BBDEFB' }}>Max Temp</Typography>
                                        <Typography variant="h5" style={{ color: 'white' }}>{predictions[0]?.max_temp || 0}°C</Typography>
                                        <Typography variant="body2" style={{ color: 'white' }}>Perfect for outdoor fun!</Typography> {/* Conclusion */}
                                    </CardContent>
                                </Card>
                            </Grid>
                            <Grid item xs={12}>
                                <Card style={{ 
                                    backgroundColor: "rgba(255, 255, 255, 0.2)", 
                                    borderRadius: "10px", 
                                    boxShadow: "0 2px 10px rgba(0, 0, 0, 0.5)", 
                                    textAlign: 'center',
                                    height: '180px', // Increased height
                                    width: '100%', // Full width for responsiveness
                                }}>
                                    <CardContent>
                                        <OpacityIcon style={{ fontSize: '50px', color: '#2196F3' }} />
                                        <Typography variant="h6" style={{ color: '#BBDEFB' }}>Humidity</Typography>
                                        <Typography variant="h5" style={{ color: 'white' }}>{predictions[0]?.humidity_9am || 0}%</Typography>
                                        <Typography variant="body2" style={{ color: 'white' }}>Watch out for the humidity!</Typography> {/* Conclusion */}
                                    </CardContent>
                                </Card>
                            </Grid>
                            <Grid item xs={12}>
                                <Card style={{ 
                                    backgroundColor: "rgba(255, 255, 255, 0.2)", 
                                    borderRadius: "10px", 
                                    boxShadow: "0 2px 10px rgba(0, 0, 0, 0.5)", 
                                    textAlign: 'center',
                                    height: '180px', // Increased height
                                    width: '100%', // Full width for responsiveness
                                }}>
                                    <CardContent>
                                        <WindPowerIcon style={{ fontSize: '50px', color: '#76FF03' }} />
                                        <Typography variant="h6" style={{ color: '#BBDEFB' }}>Wind Speed</Typography>
                                        <Typography variant="h5" style={{ color: 'white' }}>{predictions[0]?.wind_speed_9am || 0} km/h</Typography>
                                        <Typography variant="body2" style={{ color: 'white' }}>A breezy day ahead!</Typography> {/* Conclusion */}
                                    </CardContent>
                                </Card>
                            </Grid>
                        </Grid>
                    </Grid>
                    {/* Right Section */}
                    <Grid item xs={12} md={8}>
                        {/* You can add additional components or information here */}
                        {/* For example, you could show a map or more detailed weather information */}
                    </Grid>
                </Grid>
            </Container>
        </motion.div>
    );
}

export default Homepage;
